import sys
import subprocess
import base64
from PyQt5 import QtWidgets, QtGui, QtCore

class FastbootThread(QtCore.QThread):
    finished = QtCore.pyqtSignal()

    def __init__(self, device):
        super().__init__()
        self.device = device

    def run(self):
        subprocess.check_call(["fastboot", "-s", self.device, "flash", "system", "koshersystem.img"])
        subprocess.check_call(["fastboot", "-s", self.device, "flash", "boot", "kosherboot.img"])
        self.finished.emit()

class MainWindow(QtWidgets.QMainWindow):
    def __init__(self, parent=None):
        super().__init__(parent)

        self.central_widget = QtWidgets.QWidget()
        self.setCentralWidget(self.central_widget)

        logo_base64_str = ""
        logo = QtGui.QPixmap()
        logo.loadFromData(base64.b64decode(logo_base64_str))
        logo_label = QtWidgets.QLabel()
        logo_label.setPixmap(logo)
        logo_label.setAlignment(QtCore.Qt.AlignCenter)




        self.devices_combo = QtWidgets.QComboBox()
        self.update_devices_combo()

        self.refresh_button = QtWidgets.QPushButton("Refresh Devices")
        self.refresh_button.clicked.connect(self.update_devices_combo)

        self.install_button = QtWidgets.QPushButton("Install Filter")
        self.install_button.clicked.connect(self.install_filter)

        self.reboot_button = QtWidgets.QPushButton("Reboot Phone")
        self.reboot_button.clicked.connect(self.reboot)
        self.reboot_button.setEnabled(False)

        self.device_name = QtWidgets.QLabel("Device: Schok Classic Flip")
        self.version_label = QtWidgets.QLabel("Version: 1.0 - Talk & Text.")
        self.version_label.setObjectName("version_label")
        self.setStyleSheet("""
            #version_label {
                color: blue;
            }
        """)


        self.layout = QtWidgets.QVBoxLayout(self.central_widget)
        self.layout.addWidget(logo_label)
        self.layout.addWidget(self.devices_combo)
        self.layout.addWidget(self.refresh_button)
        self.layout.addWidget(self.install_button)
        self.layout.addWidget(self.reboot_button)
        self.layout.addWidget(self.device_name)
        self.layout.addWidget(self.version_label)

        self.status_bar = QtWidgets.QStatusBar()
        self.setStatusBar(self.status_bar)
        self.status_bar.showMessage("Ready")

    def update_devices_combo(self):
        output = subprocess.check_output(["fastboot", "devices"]).decode()
        lines = output.strip().split("\n")
        devices = [line.split("\t")[0] for line in lines]
        self.devices_combo.clear()
        self.devices_combo.addItems(devices)


    def install_filter(self):
        device = self.devices_combo.currentText()
        self.status_bar.showMessage("Installing filter on {}".format(device))
        self.install_button.setEnabled(False)

        self.thread = FastbootThread(device)
        self.thread.finished.connect(self.install_complete)
        self.thread.start()

    def install_complete(self):
        self.status_bar.showMessage("Install complete. Click 'Reboot Phone' to restart your device.")
        self.reboot_button.setEnabled(True)

    def reboot(self):
        device = self.devices_combo.currentText()
        self.status_bar.showMessage("Rebooting {}".format(device))
        self.reboot_button.setEnabled(False)
        subprocess.check_call(["fastboot", "-s", device, "reboot"])

if __name__ == "__main__":
    app = QtWidgets.QApplication(sys.argv)
    window = MainWindow()
    window.setWindowTitle("Schok Filter Installation")
    window.show()
    sys.exit(app.exec_())